import { BrowserRouter, Routes, Route } from 'react-router-dom';
import ShoeList from './ShoeList';
import MainPage from './MainPage';
import Nav from './Nav';

function App() {
  return (
    <BrowserRouter>
      <Nav />
      <div className="container">
        <Routes>
          <Route path="/" element={<MainPage />} />
          <Route path="/shoes" element={<ShoeList />} />
         <Route path="/shoes" element={<ShoeList />} />
          ShoeForm
        </Routes>
      </div>
    </BrowserRouter>
  );
}

export default App;
